import './App.css';
import {Routes,  Route,Link} from 'react-router-dom';
import Home from './Pages/home';
import Cart from './Pages/Cart';
import './neutron-ui.css';

function App() {
  return (
    <div className="App">

    <nav>
    <div className="logo">
    <img src="./"/>
    </div>
     <Link to="/"> Home </Link>
    <Link to="cart">Cart </Link>
    <Link to="cart">Cart </Link>
    <Link to="cart">Cart </Link>
    <Link to="cart">Cart </Link>

    </nav>

  <Routes>
  <Route path="/" element={<Home/>}/>
  <Route path="cart" element={<Cart/>}/>

  </Routes>
    </div>
  );
}

export default App;
